import React from 'react';

export interface TableHeadProps {
  children: any;
  className?: string;
}

const TableHead: React.SFC<TableHeadProps> = ({ className, children }) => {
  return (
    <thead className={`${className}`}>
      <tr>{children}</tr>
    </thead>
  );
};

export default TableHead;
